 is the adjacent side over the hypotenuse in right triangle $RPS$, we need to first find the length of the adjacent side. Given that $PQ = 2$ and $PR = \sqrt{(-\frac{7}{25})^2 + 1^2} = \frac{25}{25} = 1$ (from the %<fact1>
