Answer: Since %<fact2>$AD=BD=CD$</fact2>, we know that triangle $ABD$, triangle $ADC$, and triangle $BCD$ are all %<fact5>isosceles triangles</fact5>. Given that %<fact3>$\angle BCA = 40^\circ$</fact3>, and that the base angles of an %<fact5>isosceles triangle</fact5> are congruent, we can conclude that $\angle BCD = \angle CBD = 70^\circ$. Now, looking at triangle $ABD$, we have $\angle ABD = 180^\circ - \angle CBD - \angle ADB = 180^\circ - 70^\circ - 70^\circ = 40^\circ$. Since triangle $ABD$ is also an %<fact5>isosceles triangle</fact5>, we know that $\angle BAD = \angle ADB = 70^\circ$. Therefore, the measure of %<fact4>$\angle BAC$</fact4> is $180^\circ - \angle BAD - \angle BCA = 180^\circ - 70^\circ - 40^\circ = \boxed{70}^\circ$.

