Answer: We are given that %<fact2>$\sin{R}=\frac{2}{5}$</fact2> in %<fact1>$\triangle{RST}$</fact1>. By definition, %<fact2>$\sin{R}=\frac{2}{5}$</fact2> means that the ratio of the length of the side opposite %<fact1>$\triangle{RST}$</fact1>'s angle $R$ to the length of the hypotenuse of %<fact1>$\triangle{RST}$</fact1> is $\frac{2}{5}$. Looking at the diagram of %<fact1>$\triangle{RST}$</fact1>, we see that the side opposite angle $R$ has length $2$ and the hypotenuse has length $5$. We also see that the side opposite angle $T$ has length $\sqrt{21}$, which we can get using the Pythagorean Theorem, and the hypotenuse has length $5$. Therefore, %<fact3>$\sin{T} = \frac{\sqrt{21}}{5}$</fact3>.

